import React from "react"
import {
  BrowserRouter as Router,
  Routes,
  Route,
  NavLink,
} from "react-router-dom"
import {
  MDBBreadcrumb,
  MDBBreadcrumbItem,
  MDBContainer,
} from "mdb-react-ui-kit"

export default function App() {
  return (
    <MDBContainer className="py-2">
      <MDBBreadcrumb>
        <Routes>
          <Route
            exact
            path="*"
            element={<MDBBreadcrumbItem active>Home</MDBBreadcrumbItem>}
          ></Route>
          <Route
            path="/games"
            element={<MDBBreadcrumbItem active>Games</MDBBreadcrumbItem>}
          ></Route>
        </Routes>
      </MDBBreadcrumb>
    </MDBContainer>
  )
}
